import {Link} from 'react-router-dom';

const items = [
    {
        label : "Home",
        to : "/",
    },
    {
        label : "Appoinments",
        to : "/",
    },
    {
        label : "Home",
        to : "/",
    },
    {
        label : "Home",
        to : "/",
    }
  ]


const Navbar = () => {

  return (
    <div className='h-full w-full'>
        <section className='h-36 w-full'>
            <section className='h-32 bg-custombg mt-4 ml-4 mr-4 rounded-2xl'></section>
        </section>
    </div>
  )
}

export default Navbar
